import React from 'react';
import './Contact.css'

export default function Contact() {
  return (

    <div className="Page">
      <div className="ContactCard hvr-grow-shadow">
        <a href="/work/shape/" class="c-tile c-tile--shape" aria-label="Shape Case Study">
          <h2 class="ConTitle">Contact me!</h2>
        </a>
      </div>
    </div>

  )
}
